import React, { useState } from "react";
import Switch from "@mui/material/Switch";


function ThemeToggle({ mode, setMode }) {
    return(

    <Switch
  checked={mode === "dark"}
  onChange={() => setMode((prevMode) => (prevMode === "light" ? "dark" : "light"))}
/>
);


}

export default ThemeToggle;
